import React, {Fragment} from 'react';

class Discografia extends React.Component {
    render () {
        return (
            <div>
                <img src="" alt="cover"/>
                <p>Kiwi</p>                
                <p>Harry Styles</p>                
            </div>
        );
    }
}

class PlayerControls extends React.Component {
    render() {
        return(
            <div className='player-container'>
                <span>player here</span>
            </div>
        );
    }
}

