class PlayerContainer extends React.Component {
    render() {
        return(
            <Fragment>
                <div className='player'>
                    <footer>
                        <Discografia/>
                        <PlayerControls/>
                    </footer>
                </div>
            </Fragment>
        );
    }
}

export default PlayerContainer;
